import React, { Component } from "react";
import { Switch, Route } from "react-router-dom";
import Menu from "./menu";

const Main = () => {
	<main>
		<Switch>
			<Route exact path="/" component={Menu} />
		</Switch>
	</main>;
};

export default Main;
